import React from 'react';

const SearchBox = (props) => {
    return (
        <div className="col col-sm-4">
            <input 
            value={props.value} 
            placeholder="Enter a Movie Title"
            onChange={()=>props.setSearchValue()}></input>
        </div>
    );
};

export default SearchBox;
